function switchTabValueAdded(t){var index=$(t).attr('data-index');$('.btn-value-added').removeClass('active');$(t).addClass('active');$('.area-value-added').addClass('hidden');$('.area-value-added[data-index='+index+']').removeClass('hidden')}
function playYoutubeVideo(t){var iframe=$(t).parents('.front-yt-video').find('iframe');var src=$(iframe).attr('data-source');$(iframe).attr('src',src);$(t).remove()}
